INSERT INTO `hospitals` VALUES (1,'北京协和医院是中国医学科学院的临床医学研究所，是全国疑难重症诊治指导中心之一。医院学科齐全、技术力量雄厚，以多学科的综合优势享誉海内外。','综合医院','北京协和医院','三甲','/public/xh.jpg'),(2,'武汉市中心医院，始建于1880年，其前身为汉口天主堂医院；历经143年的建设发展，医院如今已成为一所融医疗、科研、教学、预防、培训为一体的大型现代化三级甲等医院。','综合医院','武汉市中心医院','三甲','/public/wh.jpg'),(3,'    广东省人民医院（广东省医学科学院）创建于1946年，其前身为广州中央医院。经过几代人的共同努力，广东省人民医院已成为集医教研于一体的大型现代化三级甲等综合型医院，在国内外享有盛誉。2019年国家三级公立医院绩效考核获评最高等级A++，位列全国第10；在最新的三级公立医院绩效考核中，省医排名和分数继续双提升，全国第17名，稳居A+前列，连续五年广东第二名。荣获2022全国医疗机构最佳雇主“公立医院10强”和2022最佳雇主医疗机构“最受大学生欢迎10强”。','综合医院','广东省人民医院','三甲','/public/gd.jpg');
/*!40000 ALTER TABLE `hospitals` ENABLE KEYS */;
